import React from 'react'
import styled from 'styled-component'

const Image = styled.img`
  position: relative;
  bottom: 33.33%;
  left: 33.33%;
  // visibility: hidden;
  border: red solid 1px
`


export default function HomeImage() {
  return (
    <Image>
      <svg enable-background="new 0 0 512 512" height="512px" id="Layer_1" version="1.1" viewBox="0 0 512 512" width="300px" space="preserve" xmlns="http://www.w3.org/2000/svg" xlink="http://www.w3.org/1999/xlink">
        <g>
          <polygon fill="none" points="   256,151.1 151.5,255.6 187.5,255.6 187.5,360.9 235.7,360.9 235.7,290.6 276.3,290.6 276.3,360.9 324.5,360.9 324.5,255.6    360.5,255.6  " stroke="#000000" stroke-linecap="round" stroke-linejoin="round" stroke-miterlimit="10" stroke-width="10" />
        </g>
      </svg>
    </Image >
  )
}
